import styled from 'styled-components';

import Header from '../Header';
import Records from '../Records';

const StyledLobbyList = styled.div`
  width: 100%;

  border-bottom: 1px solid #fff;

  /* overflow: auto; */
`;

const LobbyList = () => {
  return (
    <StyledLobbyList>
      <Header> <p
          style={{
            fontSize: '16px',
            fontWeight: 700,
            letterSpacing: '2px',
            marginLeft: '22px',
          }}
        >
          NEW GAME
        </p></Header>
    </StyledLobbyList>
  );
};

export default LobbyList;
